import React,{useState} from 'react'

const Bottom = () => {
	let navoption = [1,2,3,4,5,6,7]
	return (
		<div className="bottom-nav-cont">
		 <img src="" alt="" className="arrow-icons"/>
		 <div className="num-nav">
		 	{navoption.map((navs,i)=>{
		 		return(
		 		<h1 key={i} className="num">{navs}</h1>
		 		)

		 	})}
		 </div>
		 <img src="" alt="" className="arrow-icons"/>

		</div>
	)
}

export default Bottom
